import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './components/Login';

import SignUp from './components/SignUp';

function App() {
  return (

    <div>
      <Routes>
       <Route path="/signUp">
       <SignUp />
       </Route>

       <Route path ="/login">

      <Login />
       </Route>
       </Routes>
    </div>

  )
}

export default App;
